        return Axios.get("https://catfact.ninja/fact").then((res)=>{
        console.log(res.data);
        return JSON.stringify(res.data);    
        });
    // return fetch("https://catfact.ninja/fact")
    // .then((res) => res.json())
    // .then((data)=>{
    //     console.log(data)
    //   return data;
    // })
    });
      return (
    <div>
      <h1>This is the home page and user is {data?.toString()}</h1>
    </div>
  )
}

export default Home
